import tensorflow as tffrom tensorflow import kerasimport numpy as npimport matplotlib.pyplot as pltdata=keras.datasets.fashion_mnist(train_image,train_label),(test_image,test_label)=data.load_data()class_names=['Tshirt','Trouser','pullover','Dress','coat','sandal','shirt','sneakers','bag','boot']train_image =train_image/255.0test_image =test_image/255.0model = keras.Sequential([    keras.layers.Flatten(input_shape=(28,28)),    keras.layers.Dense(128, activation='relu'),    keras.layers.Dense(10,activation='softmax')])model.compile(optimizer='adam',loss='sparse_categorical_crossentropy',metrics=['accuracy'])model.fit(train_image,train_label,epochs=100)test_loss,test_acc = model.evaluate(test_image,test_label)print(test_acc)